
<style media="screen">
  body {
    margin: 0;
    background: #343434;
    display: flex;
    font-family: Open Sans, sans-serif;
  }

  #top {
    position: absolute;
    padding: 5px;
    left: 0;
    transform: translatey(-100%);
    font-weight: bold;
    color: #797979;
  }

  #reset {
    position: absolute;
    padding: 5px;
    transform: translatey(-100%);
    font-weight: bold;
    color: #797979;
    right: 0;
  }

  #start {
    position: absolute;
    padding: 5px;
    transform: translatey(-100%);
    font-weight: bold;
    color: #797979;
    right: 0;
  }

  #reset:hover {
    color: #cdcdcd;
    cursor: pointer;
  }

  #start:hover {
    color: #cdcdcd;
    cursor: pointer;
  }

  #box {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background: #232323;
  }

  .r {
    display: flex;
  }

  .ocultar {
    display: none;
  }

  i {
    width: 10px;
    height: 10px;
    border: none;
    border-radius: 50%;
    margin: 1px;
  }

  @keyframes  dotfade {
    0%    { background: #F44336; }
    33%   { background: #1E88E5; }
    66%   { background: #FDD835; }
    100%  { background: #F44336; }
  }
</style>

