<script type="text/javascript">
  var dotFadeAnim = "animation: dotfade 3s infinite;";

  document.getElementById("reset").addEventListener("click", function(e) {
    var cells = document.getElementsByTagName("I");
    for (var i = 0; i < cells.length; i++) {
      cells[i].style.animation = "none";
    }

    $('#16-18').addClass('viva').removeClass('muerta').css('animation', 'dotfade 3s infinite');
    $('#16-19').addClass('viva').removeClass('muerta').css('animation', 'dotfade 3s infinite');
    $('#15-18').addClass('viva').removeClass('muerta').css('animation', 'dotfade 3s infinite');
    $('#15-17').addClass('viva').removeClass('muerta').css('animation', 'dotfade 3s infinite');
    $('#17-18').addClass('viva').removeClass('muerta').css('animation', 'dotfade 3s infinite');

    $("#start").removeClass('ocultar');
    $("#reset").addClass('ocultar');
  });

  document.getElementById("start").addEventListener("click", function(e){
    $("#reset").removeClass('ocultar');
    $("#start").addClass('ocultar');
    start();
  });

  var gen = 0;

  function start() {
    for (var i = 1; i < 41; i++) {
      for (var j = 1; j < 101; j++) {

        var id = i+'-'+j
        var contador = 0;

        for (var a = i-1; a < i+2; a++) {
          for (var b = j-1; b < j+2; b++) {

            var _id = a+'-'+b;
            if(!(a==i && b==j)) {
              if($("#"+_id).hasClass('viva')) {
                contador++;
              }
            }

          }
        }

        if(contador == 3 && $("#"+id).hasClass('muerta')) {
          $("#"+id).addClass('nace');
        }else if((contador == 2 || contador == 3) && $("#"+id).hasClass('viva')) {
          $("#"+id).addClass('nace');
        }else {
          $("#"+id).addClass('muere')
        }
      }
    }

    $.each($('.muere'), function(index, el) {
      $(el).removeClass('muere');
      $(el).removeClass('viva');
      $(el).addClass('muerta');
      $(el).css('animation', 'none');
    });

    $.each($('.nace'), function(index, el) {
      $(el).removeClass('nace');
      $(el).removeClass('muerta');
      $(el).addClass('viva');
      $(el).css('animation', 'dotfade 3s infinite');
    });

    $('.contador').text(++gen);
    setTimeout(function(){
      start();
    },100)
  }
</script>

